import React from 'react'
import { CardIconWrapper, CardTitle, CardTitleWrapper } from './Card.elements'

const Card = (props) => {
  return (
    <>

        {props.icon}

        <CardTitle>
            {props.title}
        </CardTitle>

    </>
  )
}

export default Card
